import com.vordel.common.base64.Encoder;

def invoke(msg)         
{        
    def data = msg.get("authorization");
    String base64EncodedData = Encoder.encode(data);
    String Trim = base64EncodedData.replaceAll("(\r\n\t|\n|\r\t)", "");
    msg.put("encoded.authorization", Trim);
    return true;        
}

import com.vordel.common.base64.Decoder;

def invoke(msg)         
{        
    def base64EncodedData = msg.get("password");
    def dataDecoded = Decoder.decodeToString(base64EncodedData);
    msg.put("password", dataDecoded );
    return true;        
}

