import com.vordel.trace.Trace;
import com.vordel.config.Circuit;
import com.vordel.circuit.InvocationEngine;
import com.vordel.es.xes.PortableESPK;
import com.vordel.es.xes.PortableESPKFactory;
import groovy.json.*
def invoke(msg)
 {          
def count=(msg.get("counter")).toInteger();
def sublist=msg.get("subscriptionList");
def response_list =[];
//def json_req = '''{}''';
//def json = new JsonSlurper().parseText(json_req);
//msg.put("finalresponse",respo);
def totalKey=msg.get("keyCount");

while(count<totalKey)
{
	def newKey=sublist[count];
	msg.put("key",newKey);
	callPolicy("/Webhook/Request To Partner","01_GetEndpointData",msg);
	response_list.add('{"subscriptionkey": "' + newKey + '",' + '"href":"'+msg.get("targeturl")+'" ,'+'"response":'+msg.get("http.response.status")+'}')
	count=count+1;
}
//json << [results: response_list];
def jsontxt = '{"results" : ' + response_list + '}';
//msg.put("finalpayload",json);
msg.put("finalpayload",jsontxt);
return true;      
}
public boolean callPolicy(String policyRootPath, String policyPath,msg){
StringBuilder vCircuitESPK = new StringBuilder();
if(policyPath.indexOf('/') == 0){
buildCircuitESPK(policyRootPath+policyPath,vCircuitESPK);
}else{
buildCircuitESPK(policyRootPath+"/"+policyPath,vCircuitESPK);
}
//Trace.info("Shortcut policy:"+ vCircuitESPK.toString());
PortableESPK vEspk = PortableESPKFactory.newInstance().createPortableESPK(vCircuitESPK.toString());
Circuit vCircuit = com.vordel.dwe.Service.getInstance().getLocalPack().cache.getCircuit(vEspk);
String vContext = new String("DefaultContext");
return InvocationEngine.invokeCircuit(vCircuit,vContext,msg);
}
public void buildCircuitESPK(String policyFullPathName, StringBuilder vCircuitESPK){
if(policyFullPathName.lastIndexOf('/') == 0){
vCircuitESPK.append("<key type='FilterCircuit'>");
vCircuitESPK.append("<id field ='name' value ='"+policyFullPathName.substring(1)+"'/>");
vCircuitESPK.append("</key>");
}else{
int i = policyFullPathName.indexOf('/',1);
vCircuitESPK.append("<key type='CircuitContainer'>");
vCircuitESPK.append("<id field ='name' value ='"+policyFullPathName.substring(1,i)+"'/>");
buildCircuitESPK(policyFullPathName.substring(policyFullPathName.indexOf('/',1)), vCircuitESPK);
vCircuitESPK.append("</key>");
}
}

